import React from 'react'

const Landing = () => {
    return (
        <div className='flex flex-col  bg-black'>
            <video className='h-full' autoPlay>
                <source src={require("./videos/bgvid.mp4").default} type="video/mp4"/>
            </video> 
        </div>
    )
}

const Main = () => {
    return (
        <div className='container mx-auto pt-16'>
            <Landing />
        </div>
    )
}

export default Main
